def get_matrix_from_api(points:list[tuple]):
    import requests
    import numpy
    
    points=[point for point in points]
    try:
        full=''
        for point in points:
            full+=f'{point[1]},{point[0]};'
        #print(full)
        dist_url = f'http://34.201.241.242:5000/table/v1/driving/'+full[:-1]+'?annotations=distance'
        dura_url = f'http://34.201.241.242:5000/table/v1/driving/'+full[:-1]+'?annotations=duration'
        #print(dist_url)

        response = requests.get(dist_url)

        if response.status_code == 200:
            data = response.json()
            dist_matrix = numpy.array(data['distances'])
            
        else:
            print(response.text)
            print(response.code)
            raise
            
        
        response = requests.get(dura_url)

        if response.status_code == 200:
            data = response.json()
            dura_matrix = numpy.array(data['durations'])
            
        else:
            print(response.text)
            print(response.code)
            raise
            
    except Exception as err:
        print(err)
        return []
    
    
    return dist_matrix, dura_matrix

    